from typing import Optional, List


class Solution:
    def largestRectangleArea(self, heights: List[int]) -> int:
        maxSeen = 0
        maxPossible = max(heights)
        
        print(maxPossible)
        print("length: {}".format(len(heights)))
        for i in range(len(heights)):
            for j in range(i,len(heights)):
                width = j-i+1
                height = min(heights[i:j+1])
                curr = width * height 
                maxSeen = max(maxSeen, curr)
        return maxSeen
                
        
        pass

